import React from "react";
import './Auth.css';

const Auth= (props)=>{
    return(
        < div className="classes.Auth">
            <fieldset className="accountInfo">
                <label>Имя пользователя
                     <input type="text" id='userlogin' name="username"></input>
                </label>
                <label>Пароль
                     <input type="password" id ='userpass' name='password'></input>
                </label>
            </fieldset>
            <fieldset className="accountAction">
                <button onClick={props.authHandler()}>Войти</button>
                    <label>
                        <input type="checkbox" name="remember"/> Запомнить
                    </label>
            </fieldset>
        </div>
    )
}
export default Auth;
